description:
Allow Install/Uninstall a window service. Need to run as Administrator right.

// Install window service
WindowServiceManager.Install("TestService", "TestService", "TestService", "C:\\TestService.exe");

// Uninstall window service
WindowServiceManager.Uninstall("TestService");

// check if serice is installed
var isInstalled = WindowServiceManager.IsIntalled("TestService");

// To start/stop services, use ServiceController
var sc = ServiceController.GetServices().SingleOrDefault(s => s.ServiceName == serviceName);
// stop service
sc.Stop();
// wait for service is stopped
sc.WaitForStatus(ServiceControllerStatus.Stopped);
// start service
sc.Start();

